use dep::std;
mod hash_list;

struct Sha256VerificationProof {
    verification_key : [Field; 114],
    proof : [Field; 93],
    public_inputs : [Field; 1035],
	key_hash_index: u32
}
fn main(
	proof_data: Sha256VerificationProof
) {
    std::verify_proof(
        proof_data.verification_key.as_slice(),
        proof_data.proof.as_slice(),
        proof_data.public_inputs.as_slice(),
        hash_list::CIRCUIT_HASH_LIST[proof_data.key_hash_index]
    );
}
